from .base import Basefrom django.db import models#Registro de walets relacionadasclass Waletr(Base):    coor_ware=models.IntegerField ('Codigo de Origen',   null=True, blank=True, default=0)    orgi_ware=models.CharField    ('Origen',    max_length=1, null=True, blank=True, default='')    dire_ware=models.CharField    ('Direccion',    max_length=50, null=True, blank=True, default='')    class Meta:        ordering = ['dire_ware']        indexes  = [models.Index(fields=['id',])]         db_table = u'"comun\".\"waletr"'